Avant de continuer, ajoutons un indicateur de progression à notre sortie. C'est une façon pratique de suivre la progression d'un long rendu, et aussi une manière d'identifier un lancement bloqué à cause d'une boucle infinie ou d'un autre problème. Notre programme sort l'image via la sortie standard (std::cout), donc nous laissons ça et on affiche la progression plutôt via la sortie d'erreur (std::cerr) : for (int j = image_height-1; j >= 0; --j) { std::cerr << "Scanlines remaining: " << j << ' ' << std::flush; for (int i = 0; i < image_width; ++i) { auto r = double(i) / image_width; auto g = double(j) / image_height; auto b = 0.2; int ir = static_cast<int>(255.999 * r); int ig = static_cast<int>(255.999 * g); int ib = static_cast<int>(255.999 * b); std::cout << ir << ' ' << ig << ' ' << ib << '
'; }
}
std::cerr << "
Done.
";
